void byte_assembler(u8 * data, u32 * index);
void mySleep(u32 micros);


/************************** MAIN PROGRAM ************************************/
int main(void)
{
	u8 data [16];
    u32 index = 0;
    u32 stringlen;
    u32 gpio;

    // Initialize the system
	init_platform();
	if (do_init() != XST_SUCCESS)
		exit(1);

	// Enable interrupts and enable UART transmitter
	microblaze_enable_interrupts();
	uart_init(UART1_DEVICE_ID);

	// Get the size of the encoded image
	stringlen = strlen(image64);
    xil_printf("Len: %d\n", stringlen);


	while(1) {

		// check clear to send signal
		gpio = XGpio_DiscreteRead(&GPIOInst0, GPIO_0_INPUT_CHANNEL);

		// OK to send next byte
		if (gpio == 0) {
			// get next character and transmit
			if (index < stringlen) {

				byte_assembler(data, &index);
				uart_transmit(data, 16);
				++index;

				mySleep(TX_DELAY);
			}
		}
		else {
			mySleep(100);
		}



	}
	// cleanup and exit
    cleanup_platform();
    exit(0);
}


void byte_assembler(u8 * buff, u16 * source, u32 * index) {

	int i;
	u32 base = *index;

	for (i = 0; i < 16; ++i) {

		data[i] = image64[i + base];
		xil_printf("%c", (char)data[i]);
	}
	xil_printf("\n");
	*index += 16;
}



/**
 * @brief Crude sleep function to put small delays into the code.
 * @details mimics sleep functionality for delays
 * 
 * @param micros are the number of microseconds to "sleep"
 */
void mySleep(u32 micros) {

	u32 count;

	for (count = micros * 10000; count > 0; --count)
		;
}